import Card from "react-bootstrap/Card";
const PostCard = () => {
  return (
    <Card.Title style={{ fontSize: "16px" }}>
      <img
        src="https://genk.mediacdn.vn/2018/10/19/photo-1-15399266837281100315834-15399271585711710441111.png"
        alt="Avatar"
        style={{
          maxWidth: "50px",
          maxHeight: "50px",
          borderRadius: "50%",
        }}
      />
      Nguyễn Đăng Phòng
    </Card.Title>
  );
};

export default PostCard;
